COPY public.instructions (id, title, subtitle, body, "createdAt", "updatedAt") FROM stdin;
1	Приемка квартиры	Описаны важные шаги по приемке квартиры и ремонта в нем, если квартира идет с ремонтом	[\n  {\n    "id": 1,\n    "title": "Получаем паспорта на все счетчики",\n    "body": "<ul><li>электросчетчики</li><li>теплосчетчики на батареях</li><li>счетчики горячего и холодного водоснабжения</li></ul><p><b>Передать их обязан застройщик, а не УК</b><br /><b>Основание:</b> паспорт - это принадлежность главной вещи - счетчика, поэтому паспорт следует судьбе счетчика (ст. 135 гк), счетчик переходит в вашу собственность, значит и паспорт тоже. Если паспорт не выдают, то надо указать это в акте осмотра квартиры. Не передать паспорт - это все равно что не передать счетчик, то есть часть квартиры, которая должна быть передана на основании ДДУ.</p>"\n  },\n  {\n    "id": 2,\n    "title": "Если паспортов нет, то пишем об этом в акте осмотра квартиры",\n    "body": "<p>В передаточный акт вписать это нельзя.</p><p><b>В акте осмотра квартиры ОБЯЗАТЕЛЬНО необходимо писать:</b><ol><li>Отсутствуют паспорта на индивидуальные приборы учета электроэнергии</li><li>Отсутствуют паспорта на индивидуальные приборы учёта тепловой энергии. И сами приборы, если вдруг у вас их не оказалось</li><li>Отсутствуют паспорта на индивидуальные приборы учёта водопотребления на горячую и холодную воду</li><li>Отсутствуют терморегуляторы (если их нет). Должны быть на каждую батарею</li><li>Отсутствует шланг для первичного пожаротушения (если его нет)</li></ol></p>"\n  },\n  {\n    "id": 3,\n    "title": "Договор с УК не подписываем",\n    "body": "<p>У вас правоотношения с застройщиком, не с УК, квартиру вы купили по ДДУ. Никакие сторонние договоры тут не имеют значения и обусловливать выдачу ключей не могут.</p><p>Если настаивают и пугают невыдачей ключей, то упираем на Закон о защите прав потребителей:<br />Статья 16. Недействительность условий договора, ущемляющих права потребителя<ol><li>Условия договора, ущемляющие права потребителя по сравнению с правилами, установленными законами или иными правовыми актами Российской Федерации в области защиты прав потребителей, признаются недействительными</li><li>Запрещается обусловливать приобретение одних товаров (работ, услуг) обязательным приобретением иных товаров (работ, услуг). Убытки, причиненные потребителю вследствие нарушения его права на свободный выбор товаров (работ, услуг), возмещаются продавцом (исполнителем) в полном объеме</li></ol></p><p><b>Договор, подписанный под давлением, можно будет оспорить, но ТОЛЬКО ЧЕРЕЗ СУД. Поэтому нельзя подписывать сейчас, пока не уберут навязанные услуги</b></p>"\n  },\n  {\n    "id": 4,\n    "title": "Забираем домой все документы",\n    "body": "<p>Договор с УК - на ознакомление, акт приема-передачи (передаточный акт) - то же самое, если не подписываете. <b>Если подписываете передаточный акт, то обязательства перед вами считаются застройщиком исполненными.</b> Поэтому лучше потянуть и найти дефекты, и этим мотивировать отказ подписать акт.</p>"\n  },\n  {\n    "id": 5,\n    "title": "Если требуют написать расписку о получении договора с УК для ознакомления, то можно ее подписать",\n    "body": "<p>В ней пишем: договор с УК мною не подписан (!), копия документа взята на ознакомление. Обязуюсь вернуть копию</p>"\n  },\n  {\n    "id": 6,\n    "title": "Если дефектов в квартире нет и вы подписываете акт приема-передачи на месте, то договор с УК все равно не подписываем",\n    "body": "<p>Мотивировка - нужно ознакомиться и принять решение</p>"\n  }\n]	2020-11-12 11:45:51.595672+00	2020-11-12 11:45:51.595672+00
2	Как написать в Добродел	Добродел (Единая книга жалоб и предложений Московской области) — портал по адресу dobrodel.mosreg.ru, созданный по постановлению правительства Московской области в 2015 году для взаимодействия жителей Подмосковья с органами исполнительной власти	[\n  {\n    "id": 1,\n    "title": "Скачиваем приложение \\"Добродел\\" в AppStore или в Google Play"\n  },\n  {\n    "id": 2,\n    "title": "Регистрируемся"\n  },\n  {\n    "id": 3,\n    "title": "После регистрации нажимаем кнопку \\"Сообщить о проблеме\\""\n  },\n  {\n    "id": 4,\n    "title": "Выбираем адрес проблемы"\n  },\n  {\n    "id": 5,\n    "title": "Выбираем категорию проблемы"\n  },\n  {\n    "id": 6,\n    "title": "Указываем проблему из списка (напривмер: \\"Дворовые территории, график вывоза ТКО\\")"\n  },\n  {\n    "id": 7,\n    "title": "Описываем проблему и прикладываем к ней фотографию"\n  },\n  {\n    "id": 8,\n    "title": "Оставляем номер телефона"\n  },\n  {\n    "id": 9,\n    "title": "Ожидаем решение проблемы"\n  }\n]	2020-11-14 06:16:46.665307+00	2020-11-14 06:16:46.665307+00
3	Что должно УК выдать в момент подписания АПП		[\n  {\n    "id": 1,\n    "title": "Акт осмотра (с замечаниями)"\n  },\n  {\n    "id": 2,\n    "title": "Акт приема-передачи"\n  },\n  {\n    "id": 3,\n    "title": "Договор управленич"\n  },\n  {\n    "id": 4,\n    "title": "Акт получения ключей"\n  },\n  {\n    "id": 5,\n    "title": "Ключи от квартиры"\n  },\n  {\n    "id": 6,\n    "title": "Акт ввода приборов учета"\n  },\n  {\n    "id": 7,\n    "title": "Паспорта на индивидуальные приборы учета"\n  },\n  {\n    "id": 8,\n    "title": "Терморегуляторы"\n  },\n  {\n    "id": 9,\n    "title": "Пожарный рукав"\n  },\n  {\n    "id": 10,\n    "title": "Магнитные ключи"\n  },\n  {\n    "id": 11,\n    "title": "Ключи от почтового ящика"\n  },\n  {\n    "id": 12,\n    "title": "Ключи от электрощитка в коридоре"\n  },\n  {\n    "id": 13,\n    "title": "Ключи для доступа к стоякам водоснабжения в МОПе"\n  },\n  {\n    "id": 14,\n    "title": "Схему электропроводки (по запросу)"\n  },\n  {\n    "id": 15,\n    "title": "Инструкции по эксплуатации установленного оборудования, с указанием гарантийных сроков"\n  }\n]	2020-11-22 09:39:33.88267+00	2020-11-22 09:39:33.88267+00
